import React from 'react';


const Item = ({ kind, artistName, trackName, artworkUrl100 }) => (
    <div>
        <div>{kind}</div>
        <div>{artistName} </div>
        <div>{trackName} </div>
        <img src={artworkUrl100} />

    </div>

);

export default Item;
